import React from 'react';

interface ButtonProps extends React.ButtonHTMLAttributes<HTMLButtonElement> {
  children: React.ReactNode;
}

const Button: React.FC<ButtonProps> = ({ children, className, ...props }) => {
  return (
    <div
      className={`
        inline-flex justify-start items-start
        group
      `}
    >
      <button
        className={`
          px-4 py-2
          border border-transparent
          bg-white
          text-primary-blue text-xs font-medium font-dm-sans leading-4
          rounded-[18px]
          shadow-[0_0_0_1px_#E6E9EC_inset]
          transition-all duration-150
          hover:shadow-[0_0_0_1px_#195AFE_inset] hover:bg-[#F3F7FF]
          active:shadow-[0_0_0_1px_#195AFE_inset] active:bg-[#E8EEFF]
          disabled:text-[#b6bec6] disabled:shadow-[0_0_0_1px_#E6E9EC_inset] disabled:bg-transparent disabled:cursor-not-allowed
          ${className || ''}
        `}
        {...props}
      >
        {children}
      </button>
    </div>
  );
};

export default Button;
